        Rom_cos_i <= Rom_cos_L32_i;
    elsif pft_adress = "0000000000" or pft_adress = "0000001100" or pft_adress = "1100000000" then
        Rom_cos_i <= Rom_cos_L40_i;
    end if; 
 end process;

